import React from "react";
import { Link } from 'react-router-dom';
import "../styles.css";


const SignIn = () => {
  return (
    <div className="sign-in-box">
      <div className="sign-in-center">
        <p>Hope You'll Join Us!</p>

        <input type="text" className="email-input" placeholder="Email..."/>
        <input type="text" className="password-input" placeholder="Password..."/>
        <input type="submit" className = "submit-imput" value="Create Your Account"></input>
        <div>Or sign up with:</div>
        <div style={{padding: '10px'}}>
          <i className="fab fa-google social-media-icons"></i>     
          <i className="fab fa-facebook social-media-icons"></i>
          <i className="fab fa-twitter social-media-icons"></i>
          </div>
          <Link to='/signin'>
          <button style={{textAlign:'right'}}>Sign-In</button>
          </Link>
       </div>


    </div>
  );
};

export default SignIn;
